float sqrt(int num) {
    float sqrt = num / 2.0; // Initial guess
    float temp = 0;

    while (sqrt != temp) {
        temp = sqrt;
        sqrt = (num / temp + temp) / 2.0; // Applying Newton-Raphson method
    }

    return sqrt;
}

