void draw_title(){
   int x, y;
    for (y = 0; y < 240; y++) {
        for (x = 0; x < 320; x++) {
            plot_pixel(x, y, title[x][y]);
        }
    }
}
void draw_win(){
   int x, y;
    for (y = 0; y < 240; y++) {
        for (x = 0; x < 320; x++) {
            plot_pixel(x, y, win_screen[x][y]);
        }
    }
}
void draw_gameover(){
   int x, y;
    for (y = 0; y < 240; y++) {
        for (x = 0; x < 320; x++) {
            plot_pixel(x, y, game_over[x][y]);
        }
    }
}